import React from 'react';
import { LaunchMissionInfoQuery } from './../../generated/graphql'
import './styles.css'

interface Props {
    data: LaunchMissionInfoQuery
}

const MissionInfo: React.FC<Props> = ({ data }) => {
    delete data.__typename
    // data.launch?.details
    // data.launch?.launch_site
    // data.launch?.launch_success
    // data.launch?.launch_year
    // data.launch?.links
    // data.launch?.mission_name
    // data.launch?.rocket
    const cleansenedData= {
        details:data.launch?.details,
        launch_site:data.launch?.launch_site?.site_name,
        launch_success:data.launch?.launch_success,
        launch_year:data.launch?.launch_success,
        images_links:data.launch?.links?.flickr_images,
        mission_name:data.launch?.mission_name,
        rocket_name:data.launch?.rocket?.rocket_name,
        rocket_type:data.launch?.rocket?.rocket_type,

    }
    console.log(data)
    return (
        <div>
            <h3 className={JSON.stringify(data.launch?.launch_success)}>{JSON.stringify(data.launch?.mission_name)}</h3>
            {/* {JSON.stringify(data)} */}
            <div>
                {Object.keys(JSON.parse(JSON.stringify(data.launch))).map((val: any, ind: number) => {
                    return (<div> {val.replace(/_/g, ' ').toUpperCase()}</div>)
                })}
            </div>
            <div className="details-div-container">
                {Object.values(JSON.parse(JSON.stringify(data.launch))).map((val: any, ind: number) => {
                    if(val!==null){
                    return (<div className="details-div">{Object.values(val)}</div>)}
                    else{return "Not Found On Public Records"}
                })}
            </div>
        </div>
    )
}

export default MissionInfo;
